pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";

contract SellNFT is Ownable, Pausable {
    event Sent(address indexed payee, uint256 amount, uint256 balance);
    event Received(
        address indexed payer,
        uint256 tokenId,
        uint256 amount,
        uint256 balance
    );

    ERC721 public nftAddress;

    constructor(address _nftAddress) {
        require(_nftAddress != address(0) && _nftAddress != address(this));
        nftAddress = ERC721(_nftAddress);
    }

    function _sendNft(
        address tokenOwner,
        address sendTo,
        uint256 _tokenId
    ) private {
        require(msg.sender != address(0) && msg.sender != address(this));
        nftAddress.safeTransferFrom(tokenOwner, msg.sender, _tokenId);
        emit Received(sendTo, _tokenId, msg.value, address(this).balance);
    }

    function _sendPayment(address _payee, uint256 _amount) private {
        require(_payee != address(0) && _payee != address(this));
        require(_amount > 0 && _amount <= address(this).balance);
        payable(_payee).transfer(_amount);
        emit Sent(_payee, _amount, address(this).balance);
    }

    function sellNft(
        uint256 _amount,
        uint256 _tokenId,
        uint256 _deadline,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) public payable {
        require(block.timestamp < _deadline, "Signed Transaction Expired");
        address sender = msg.sender;
        uint256 chainId;
        assembly {
            chainId := chainid()
        }

        bytes32 eip712DomainHash = keccak256(
            abi.encode(
                keccak256(
                    "EIP712Domain(string name, string version, uint256 chainId, address verifyingContract)"
                ),
                keccak256(bytes("SetTest")),
                keccak256(bytes("1")),
                chainId,
                address(this)
            )
        );

        bytes32 hashStruct = keccak256(
            abi.encode(
                keccak256(
                    "set(address sender, uint256 amount, uint256 tokenid, uint deadline)"
                ),
                sender,
                _amount,
                _tokenId,
                _deadline
            )
        );

        bytes32 hash = keccak256(
            abi.encodePacked("\x19\x01", eip712DomainHash, hashStruct)
        );

        address signer = ecrecover(hash, v, r, s);
        require(signer == this.owner(), "Invalid Signature");
        require(signer != address(0));

        address tokenOwner = nftAddress.ownerOf(_tokenId);
        address sendTo = msg.sender;

        _sendNft(tokenOwner, sendTo, _tokenId);
        _sendPayment(tokenOwner, _amount);
    }
}
